"use strict";(self.webpackChunktest=self.webpackChunktest||[]).push([[265],{8799(i,t,e){e.r(t),e.d(t,{comp:()=>g,data:()=>r});var s=e(641);const n={},g=(0,e(6262).A)(n,[["render",function(i,t){return(0,s.uX)(),(0,s.CE)("div",null,[...t[0]||(t[0]=[(0,s.Fv)('<h1 id="git" tabindex="-1"><a class="header-anchor" href="#git"><span>Git</span></a></h1><hr><p>aliases:</p><ul><li>git 标题: git</li></ul><hr><h2 id="git如何设置-清除代理" tabindex="-1"><a class="header-anchor" href="#git如何设置-清除代理"><span><strong>Git如何设置/清除代理</strong></span></a></h2><p><strong>笔记本：</strong> git</p><p><strong>创建时间：</strong> 2024/3/10 21:38 <strong>更新时间：</strong> 2024/3/10 21:39</p><p><strong>设置ss</strong></p><p>git config --global http.proxy ‘socks5://127.0.0.1:1080’</p><p>git config --global https.proxy ‘socks5://127.0.0.1:1080’</p><p><strong>设置代理</strong></p><p>git config --global http.proxy http://127.0.0.1:1080</p><p>git config --global https.proxy https://127.0.0.1:1080</p><p><strong>取消代理</strong></p><p>git config --global --unset http.proxy</p><p>git config --global --unset https.proxy</p><p><strong>清除git项目的git信息</strong></p><p><strong>笔记本：</strong> git</p><p><strong>创建时间：</strong> 2024/3/1 17:43 <strong>更新时间：</strong> 2024/3/1 17:47</p><p><strong>URL：</strong> https://blog.csdn.net/zh1442113005/article/details/127011504</p><h2 id="清除git项目的git信息" tabindex="-1"><a class="header-anchor" href="#清除git项目的git信息"><span><strong>清除git项目的git信息</strong></span></a></h2><h4 id="_1-查看当前-git提交-拉取路径" tabindex="-1"><a class="header-anchor" href="#_1-查看当前-git提交-拉取路径"><span><strong>1.查看当前 git提交 拉取路径</strong></span></a></h4><div class="language-text line-numbers-mode" data-highlighter="prismjs" data-ext="text"><pre><code><span class="line">   git remote -v</span>\n<span class="line"></span></code></pre><div class="line-numbers" aria-hidden="true" style="counter-reset:line-number 0;"><div class="line-number"></div></div></div><p>2.删除当前的路径</p><div class="language-text line-numbers-mode" data-highlighter="prismjs" data-ext="text"><pre><code><span class="line">   git remote rm origin</span>\n<span class="line"></span></code></pre><div class="line-numbers" aria-hidden="true" style="counter-reset:line-number 0;"><div class="line-number"></div></div></div><p>3.打开.idea文件夹下的 <a href="https://so.csdn.net/so/search?q=vcs&amp;spm=1001.2101.3001.7020" target="_blank" rel="noopener noreferrer">vcs</a> .xml文件，将当前vcs设置的值改为NONE</p><div class="language-text line-numbers-mode" data-highlighter="prismjs" data-ext="text"><pre><code><span class="line">   vcs =&quot;NONE&quot; /&gt;</span>\n<span class="line"></span></code></pre><div class="line-numbers" aria-hidden="true" style="counter-reset:line-number 0;"><div class="line-number"></div></div></div><p>4.重启 idea 就可以了</p><h2 id="git误操作提交或推送代码到远程的回滚方法" tabindex="-1"><a class="header-anchor" href="#git误操作提交或推送代码到远程的回滚方法"><span><strong>git误操作提交或推送代码到远程的回滚方法</strong></span></a></h2><p><strong>笔记本：</strong> git</p><p><strong>创建时间：</strong> 2021/12/31 18:58 <strong>更新时间：</strong> 2022/1/4 14:46</p><p><strong>作者：</strong> 彼岸樱速</p><p>有些时候，会在git操作失误，这时候需要一些办法来恢复到我们想要的版本 大致有两种办法~</p><p><strong>一、暴力推送（不推荐）</strong></p><div class="language-text line-numbers-mode" data-highlighter="prismjs" data-ext="text"><pre><code><span class="line">1、git reset --hard</span>\n<span class="line">2、git cherry-pick</span>\n<span class="line">3、git push origin HEAD --force</span>\n<span class="line"></span></code></pre><div class="line-numbers" aria-hidden="true" style="counter-reset:line-number 0;"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><ul><li>第一小步：使用git reset --hard 或soft，强制或软恢复代码到某个版本下，就是把新的内 容都重置到未提交的状态。</li><li>第二小步：你回滚的内容，可能是由于，别人发版本，跟自己的版本隔了几个版本，有部 分代码是需要回滚的，但是别人或者自己的代码不能回滚，就使用git cherry -pick来把需 要恢复代码给pick(挑拣)出来，放到待提交列表里面去。</li><li>第三小步：强制推送当前已经挑拣清晰，也就是清晰完毕的版本，强制推送到远端分支 去。但这里需要注意的是，此操作其实是很危险的，覆盖代码的操作还是少用啦~</li></ul><p>***上面第三步如果强制推送失败，gitlab的话一般是因为开启了分支保护机制。可以在仓库的 设置页面，找到protect对应的标签下面，把保护分支暂时去除，过后再重新开启</p><img src="/img/git.pdf-2-1.png"><p>网上的说法~</p><img src="/img/git.pdf-2-2.png"><p>所以，下面是第二种</p><p><strong>二、使用git revert（推荐）</strong></p><p>以下是 git renert 的三种用法</p><div class="language-text line-numbers-mode" data-highlighter="prismjs" data-ext="text"><pre><code><span class="line">git revert HEAD ：撤销前一次 commit </span>\n<span class="line">git revert HEAD^ ：撤销前前一次 commit </span>\n<span class="line">git revert (commit id)： 撤销指定的版本，撤销也会作为一次提交进行保存。 </span>\n<span class="line"></span></code></pre><div class="line-numbers" aria-hidden="true" style="counter-reset:line-number 0;"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>下面是测试demo</strong></p><p>1、git checkout -b newmaster</p><img src="/img/git.pdf-3-0.png"><p>2、git push origin newmaster:newmaster</p><img src="/img/git.pdf-3-1.png"><p>3、修改当前分支，某个配置文件然后提交，推送，如</p><img src="/img/git.pdf-3-2.png"><p>4、再修改一个版本，提交推送</p><img src="/img/git.pdf-3-3.png"><p>5、切回到master分支，并把newmaster的内容合并过来，并且推送。</p><img src="/img/git.pdf-4-0.png"><p>6、使用revert命令，回滚提交</p><ol><li>连续</li></ol><p>git revert -n commit_id_start..commit_id_end 使用该命令可以将提交撤回到commit_id_start的位置 2. 不连续</p><p>git revert -n commit_id_1 git revert -n commit_id_3 Revert之后，再推送，就可以回滚某次commit_id对应的所有提交内容。</p><p>7、或者直接在sourceTree上操作</p><img src="/img/git.pdf-4-1.png"><p>从上面可以看出，使用revert会把某个提交下的内容全部放弃，并放到待提交列表里面，此时再 次推送，就可以恢复某个或者某些版本的代码了~</p><h2 id="idea上传代码到gitee" tabindex="-1"><a class="header-anchor" href="#idea上传代码到gitee"><span><strong>IDEA上传代码到gitee</strong></span></a></h2><p><strong>笔记本：</strong> git</p><p><strong>创建时间：</strong> 2021/9/24 16:35 <strong>更新时间：</strong> 2021/9/24 16:41</p><p><strong>作者：</strong> 彼岸樱速</p><p>步骤1：创建远程项目</p><img src="/img/git.pdf-5-0.png"><p>步骤2：复制远程项目地址 注意：此处码云官方已经给出上传项目方法，不过用的是命令行的形式，我们选择一种更加简单的方法。</p><img src="/img/git.pdf-5-1.png"><p>步骤3：创建好本地项目，点击VCS,按照图中指示给项目创建Git仓库。</p><img src="/img/git.pdf-6-0.png"><p>步骤4：选择此项目的根目录作为仓库。</p><img src="/img/git.pdf-6-1.png"><p>步骤5：选中项目名先将项目add到缓冲区，再commit到本地仓库。</p><img src="/img/git.pdf-7-0.png"><p>这里放一张git的add和commit图解帮助大家理解为什么一个新的项目要先add再commit：</p><img src="/img/git.pdf-7-1.png"><p>步骤6：点击Commit Directory后在弹出框中填写Commit Message(提交信息），然后选择Commit and Push。</p><img src="/img/git.pdf-8-0.png"><p>步骤7：在弹出的Push Commits对话框中点击“Define remote&quot;,填入步骤2中复制的远程项目地址。</p><img src="/img/git.pdf-8-1.png"><p>步骤8：点击push。</p><img src="/img/git.pdf-9-0.png"><p>步骤9：查看Version Control--》log</p><img src="/img/git.pdf-9-1.png"><p>步骤10：上传成功！</p><img src="/img/git.pdf-10-0.png"><p>下次更新代码直接：</p><p>在Terminal中输入命令</p><div class="language-text line-numbers-mode" data-highlighter="prismjs" data-ext="text"><pre><code><span class="line">git add .</span>\n<span class="line">git commit -m &quot;备注&quot;</span>\n<span class="line">git pull</span>\n<span class="line">git push</span>\n<span class="line"></span></code></pre><div class="line-numbers" aria-hidden="true" style="counter-reset:line-number 0;"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div>',92)])])}]]),r=JSON.parse('{"path":"/guide/git.html","title":"Git","lang":"zh-CN","frontmatter":{},"headers":[{"level":2,"title":"Git如何设置/清除代理","slug":"git如何设置-清除代理","link":"#git如何设置-清除代理","children":[]},{"level":2,"title":"清除git项目的git信息","slug":"清除git项目的git信息","link":"#清除git项目的git信息","children":[]},{"level":2,"title":"git误操作提交或推送代码到远程的回滚方法","slug":"git误操作提交或推送代码到远程的回滚方法","link":"#git误操作提交或推送代码到远程的回滚方法","children":[]},{"level":2,"title":"IDEA上传代码到gitee","slug":"idea上传代码到gitee","link":"#idea上传代码到gitee","children":[]}],"git":{"updatedTime":1767876144000,"contributors":[{"name":"wuyuying","username":"wuyuying","email":"wuyuying@foresee.com.cn","commits":1,"url":"https://github.com/wuyuying"}],"changelog":[{"hash":"4754c4bfd6634aea6124846c326c9833f398bc89","time":1767876144000,"email":"wuyuying@foresee.com.cn","author":"wuyuying","message":"git"}]},"filePathRelative":"guide/git.md","excerpt":"\\n<hr>\\n<p>aliases:</p>\\n<ul>\\n<li>git\\n标题: git</li>\\n</ul>\\n<hr>\\n<h2><strong>Git如何设置/清除代理</strong></h2>\\n<p><strong>笔记本：</strong> git</p>\\n<p><strong>创建时间：</strong> 2024/3/10 21:38 <strong>更新时间：</strong> 2024/3/10 21:39</p>\\n<p><strong>设置ss</strong></p>\\n<p>git config --global http.proxy ‘socks5://127.0.0.1:1080’</p>"}')}}]);